import { BrowserRouter,Route } from "react-router-dom";
import "./App.css";
import ComputerForm from "./Components/ComputerForm";
import ComputerList from "./Components/ComputerList";
import Navbar from "./Components/Navbar";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Navbar/>
        <Switch>
          <Route  path="/" component={ComputerList}/>
          <Route path="/computerForm" component={ComputerForm}/>
        </Switch>

      </BrowserRouter>


    </div>
  );
}

export default App;
